    const submitHandler = e => {
        e.preventDefault();

        Login(details);
    }

    

    return (
            <div>
                <h1>Välkommen till Truly</h1>

                <div>
                    <p>För att interagera med våra användare behöver du först lära dig mer om dig själv genom att göra ett test. <br /><br />
